import React from "react";

import { Desciptor } from "../../molecules";
import Icons from "../../../resources/icons";
import "./index.scss";

const DESCRIPTOR_ICON_CORRESPONDANCE = {
  ...Icons,
  age: Icons.user,
  experience: Icons.expertise,
  scope: Icons.ping_drop,
  comfort: Icons.computer,
};

export const Descriptors = ({
  email,
  phone,
  location,
  age,
  rating,
  experience,
  price,
  service,
  comfort,
  scope,
}) => {
  const DescriptorsComponents = Object.entries({
    email,
    phone,
    location,
    age,
    rating,
    experience,
    price,
    service,
    comfort,
    scope,
  })
    .filter(([_, value]) => value)
    .map(([key, value]) => {
      return (
        <Desciptor
          key={key}
          name={key}
          value={value}
          icon={DESCRIPTOR_ICON_CORRESPONDANCE[key]}
        />
      );
    });

  return (
    <div id="user-descriptors">
      <div className="descriptors-container border-radius box">
        {DescriptorsComponents}
      </div>
    </div>
  );
};
